import styled from "@emotion/styled";

export const NavContainer = styled.nav`

display: flex;
align-items: center;
justify-content: space-around;
  background-color: turquoise;
  padding: 1em 0;
  margin-bottom: 2em;
  @media only screen and (max-width: 600px) {
  background-color: red;
  } 
`;
